import React from 'react';
import { Row, Col, Card, Typography } from 'antd';
import { SmileOutlined, CodeOutlined, MailOutlined } from '@ant-design/icons';

const { Title, Paragraph } = Typography;

const Home = () => {
  return (
    <div style={{ 
      padding: '24px',
      maxWidth: '1200px',
      margin: '0 auto'
    }}>
      {/* Main Header */}
      <Title 
        level={1} 
        style={{ 
          textAlign: 'center', 
          marginBottom: '16px',
          fontWeight: '600',
          color: '#1d1d1d'
        }}
      >
        Welcome to My Portfolio
      </Title>
      
      <Paragraph 
        style={{ 
          textAlign: 'center', 
          fontSize: '18px', 
          marginBottom: '60px',
          color: '#555'
        }}
      >
        I'm a developer passionate about creating amazing web applications.
      </Paragraph>

      {/* Feature Cards */}
      <Row gutter={[32, 32]} justify="center">
        {/* About Card */}
        <Col xs={24} sm={12} lg={8}>
          <Card 
            style={{
              borderRadius: '12px',
              boxShadow: '0 4px 12px rgba(0, 0, 0, 0.1)',
              border: 'none',
              height: '100%'
            }}
            title={
              <span style={{ fontSize: '20px', fontWeight: '500' }}>
                <SmileOutlined style={{ 
                  marginRight: '10px',
                  color: '#1890ff',
                  fontSize: '22px'
                }} />
                About Me
              </span>
            }
            bordered={false}
            hoverable
          >
            <Paragraph style={{ fontSize: '16px', marginBottom: 0 }}>
              Learn more about my background and skills.
            </Paragraph>
          </Card>
        </Col>

        {/* Projects Card */}
        <Col xs={24} sm={12} lg={8}>
          <Card 
            style={{
              borderRadius: '12px',
              boxShadow: '0 4px 12px rgba(0, 0, 0, 0.1)',
              border: 'none',
              height: '100%'
            }}
            title={
              <span style={{ fontSize: '20px', fontWeight: '500' }}>
                <CodeOutlined style={{ 
                  marginRight: '10px',
                  color: '#1890ff',
                  fontSize: '22px'
                }} />
                Projects
              </span>
            }
            bordered={false}
            hoverable
          >
            <Paragraph style={{ fontSize: '16px', marginBottom: 0 }}>
              Check out my latest work and projects.
            </Paragraph>
          </Card>
        </Col>

        {/* Contact Card */}
        <Col xs={24} sm={12} lg={8}>
          <Card 
            style={{
              borderRadius: '12px',
              boxShadow: '0 4px 12px rgba(0, 0, 0, 0.1)',
              border: 'none',
              height: '100%'
            }}
            title={
              <span style={{ fontSize: '20px', fontWeight: '500' }}>
                <MailOutlined style={{ 
                  marginRight: '10px',
                  color: '#1890ff',
                  fontSize: '22px'
                }} />
                Contact
              </span>
            }
            bordered={false}
            hoverable
          >
            <Paragraph style={{ fontSize: '16px', marginBottom: 0 }}>
              Get in touch for collaborations or opportunities.
            </Paragraph>
          </Card>
        </Col>
      </Row>
    </div>
  );
};

export default Home;
